import Bootstrap from './Bootstrap';
import RecentBlogs from './RecentBlogs';
import Search from './Search';
import { Container, Row, Col } from 'react-bootstrap'

const Home = () => {
    return (
        <div>
            <Container fluid>
                <Row>
                    <Col md="auto">
                        <Search />
                    </Col>
                </Row>
            </Container>

            <Bootstrap />
            <RecentBlogs />
        </div>
    )
}

export default Home
